var title_f22_7_22640="Illustration of osteoblast and osteoclast formation";
var content_f22_7_22640=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F50298&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F50298&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 589px\">",
"   <div class=\"ttl\">",
"    Schematic illustration of the regulation of osteoblast and osteoclast formation by osteocytes",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 569px; height: 317px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Increased production of sclerostin by osteocytes inhibits Wnt signaling and thereby suppresses the differentiation of osteoblasts from mesenchymal stem cells (MSC). Osteocyte-derived RANKL, on the other hand, stimulates osteoclastogenesis from hematopoietic stem cells (HSC). This allows osteocytes to independently alter the rate of remodeling and the balance between formation and resorption in response to mechanical needs or hormonal changes.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Dr. Jinhu Xiong and Dr. Charles O'Brien, University of Arkansas for Medical Sciences.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
