var title_f22_7_22653="Asthma severity 12 and up";
var content_f22_7_22653=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F71425&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F71425&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Classifying asthma severity in youths greater than or equal to 12 years of age and adults",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"2\" rowspan=\"3\">",
"        Components of severity",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"4\">",
"        Classification of asthma severity (youths &ge;12 years of age and adults)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\" rowspan=\"2\">",
"        Intermittent",
"       </td>",
"       <td class=\"subtitle2\" colspan=\"4\">",
"        Persistent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3\">",
"        Mild",
"       </td>",
"       <td class=\"subtitle3\">",
"        Moderate",
"       </td>",
"       <td class=\"subtitle3\">",
"        Severe",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"5\">",
"        <p>",
"         Impairment",
"        </p>",
"        <p>",
"         Normal FEV",
"         <sub>",
"          1",
"         </sub>",
"         /FVC:",
"        </p>",
"        <p>",
"         8-19 yr 85 percent",
"        </p>",
"        <p>",
"         20-39 yr 80 percent",
"        </p>",
"        <p>",
"         40-59 yr 75 percent",
"        </p>",
"        <p>",
"         60-80 yr 70 percent",
"        </p>",
"       </td>",
"       <td>",
"        Symptoms",
"       </td>",
"       <td>",
"        &le;2 days/week",
"       </td>",
"       <td>",
"        &gt;2 days/week but not daily",
"       </td>",
"       <td>",
"        Daily",
"       </td>",
"       <td>",
"        Throughout the day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Nighttime awakenings",
"       </td>",
"       <td>",
"        &le;2x/month",
"       </td>",
"       <td>",
"        3-4x/month",
"       </td>",
"       <td>",
"        &gt;1x/week but not nightly",
"       </td>",
"       <td>",
"        Often 7x/week",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Short-acting beta",
"        <sub>",
"         2",
"        </sub>",
"        -agonist use for symptom control (not prevention of EIB)",
"       </td>",
"       <td>",
"        &le;2 days/week",
"       </td>",
"       <td>",
"        &gt;2 days/week but not &gt;1x/day",
"       </td>",
"       <td>",
"        Daily",
"       </td>",
"       <td>",
"        Several times per day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Interference with normal activity",
"       </td>",
"       <td>",
"        None",
"       </td>",
"       <td>",
"        Minor limitation",
"       </td>",
"       <td>",
"        Some limitation",
"       </td>",
"       <td>",
"        Extremely limited",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lung function",
"       </td>",
"       <td>",
"        <p>",
"         &bull; Normal FEV",
"         <sub>",
"          1",
"         </sub>",
"         between exacerbations",
"        </p>",
"        <p>",
"         &bull; FEV",
"         <sub>",
"          1",
"         </sub>",
"         &gt;80 percent predicted",
"        </p>",
"        <p>",
"         &bull; FEV",
"         <sub>",
"          1",
"         </sub>",
"         /FVC normal",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         &bull; FEV",
"         <sub>",
"          1",
"         </sub>",
"         &ge;80 percent predicted",
"        </p>",
"        <p>",
"         &bull; FEV",
"         <sub>",
"          1",
"         </sub>",
"         /FVC normal",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         &bull; FEV",
"         <sub>",
"          1",
"         </sub>",
"         &gt;60 but &lt;80 percent predicted",
"        </p>",
"        <p>",
"         &bull; FEV",
"         <sub>",
"          1",
"         </sub>",
"         /FVC reduced 5 percent",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         &bull; FEV",
"         <sub>",
"          1",
"         </sub>",
"         &lt;60 percent predicted",
"        </p>",
"        <p>",
"         &bull; FEV",
"         <sub>",
"          1",
"         </sub>",
"         /FVC reduced &gt;5 percent",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        Risk",
"       </td>",
"       <td rowspan=\"4\">",
"        <strong>",
"         Exacerbations requiring oral systemic corticosteroids",
"        </strong>",
"       </td>",
"       <td>",
"        <strong>",
"         0-1/year (see footnote)",
"        </strong>",
"       </td>",
"       <td colspan=\"3\">",
"        <strong>",
"         &ge;2/year (see footnote)",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <strong>",
"         Consider severity and interval since last exacerbation",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <strong>",
"         Frequency and severity may fluctuate over time for patients in any severity category",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <strong>",
"         Relative annual risk of exacerbations may be related to FEV",
"         <sub>",
"          1",
"         </sub>",
"        </strong>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     Classifying severity for patients who are not currently taking long-term control medications.",
"    </strong>",
"    Level of severity is determined by assessment of both impairment and risk. Assess impairment domain by patient's/caregiver's recall of previous 2-4 weeks and spirometry. Assign severity to the most severe category in which any feature occurs. At present, there are inadequate data to correspond frequencies of exacerbations with different levels of asthma severity. In general, more frequent and intense exacerbations (eg, requiring urgent, unscheduled care, hospitalization, or ICU admission) indicate greater underlying disease severity. For treatment purposes, patients who had &ge;2 exacerbations requiring oral systemic corticosteroids in the past year may be considered the same as patients who have persistent asthma, even in the absence of impairment levels consistent with persistent asthma.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: National Heart, Blood, and Lung Institute Expert Panel Report 3 (EPR 3): Guidelines for the Diagnosis and Management of Asthma. NIH Publication no. 08-4051, 2007.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
